import React from 'react';
import '../App.css';

const ContactUs = () => {
    return ( 
        <>
        <div className='contactUsContainer' id='contact'>
            <div className='contactUsWrapper'>
                <div className='contactUsInfo'>
                    <div className='contactUsTxt'>
                        <h1 className='contactUsH1'>Contact us for more information!</h1>
                        <div className='contactUsFormConta'>
                            <form className='contactUsForm' action='/' method='post'>
                                <label name='email'>Email</label>
                                <input name='email' type='email'/><br/>
                                <textarea className='contactUsTextArea' placeholder='question, inqueries, etc...'/>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        </>
    );
}
 
export default ContactUs;
